DROP TABLE Contract;
DROP TABLE Supply;
DROP TABLE Purchase;
DROP TABLE Employee;
DROP TABLE Customer;
DROP TABLE Phones;
DROP TABLE Supplier;

CREATE TABLE Supplier(
    supplierName varchar(30),
    contactPhone char(12),
    PRIMARY KEY(supplierName)
    );

CREATE TABLE Phones(
    productCode char(11),
    make varchar(17),
    model varchar(13),
    stockQuantity int,
    retailPrice int,
    PRIMARY KEY(productCode)
    );
    
CREATE TABLE Customer(
    custID varchar(4),
    custName varchar(25),
    PRIMARY KEY(custID)
    );

CREATE TABLE Employee(
    empID varchar(2),
    empName varchar(16),
    position varchar(17),
    PRIMARY KEY(empID)
    );
    
CREATE TABLE Purchase(
    purchaseNo char(12),
    purchaseDate date,
    custID varchar(4),
    productCode char(11),
    empID varchar(2),
    PRIMARY KEY(purchaseNo),
    FOREIGN KEY(custID) REFERENCES Customer(custID),
    FOREIGN KEY(productCode) REFERENCES Phones(productCode),
    FOREIGN KEY(empID) REFERENCES Employee(empID)
    );
    
CREATE TABLE Supply(
    supplierName varchar(30),
    productCode char(11),
    supplyPrice int,
    supplyQuantity int,
    supplyDate date,
    PRIMARY KEY(supplierName, productCode),
    FOREIGN KEY(supplierName) REFERENCES Supplier(supplierName),
    FOREIGN KEY(productCode) REFERENCES Phones(productCode)
    );

CREATE TABLE Contract(
    contractNo char(12),
    purchaseNo char(12),
    contractTerm int,
    contractPrice int,
    PRIMARY KEY(contractNo, purchaseNo),
    FOREIGN KEY(purchaseNo) REFERENCES Purchase(purchaseNo)
    );
 
   












